import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

export default function ShuttleService() {
  return (
    <div style={{ color: "#CFE2F3", lineHeight: 10, padding: 20 }}>
      <Route
        path="/faq"
        component={() =>
          (window.location = "../WINTER2023BlueSHUTTLECALENDAR.pdf")
        }
      />

      <h2>ShuttleService</h2>
      <h2>Campus Shuttle Schedule: Fall / Winter 2022 - 2023:</h2>
      <ul>
        <li>
          <a href="/faq"> WINTER 2023 Blue SHUTTLE CALENDAR </a>
        </li>
      </ul>
    </div>
  );
}
